import "./App.css";

import AddStudent from "./components/AddStudent";
import Header from "./components/Header";
import { BrowserRouter as Router, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Routes path="/add" exact Component={AddStudent} />
      </div>
    </Router>
  );
}

export default App;
